description:
&quot;There is just something about shooting POV, just me, a super pretty girl, and the camera. No one else around. Everything is spontaneous and there is a true feeling of intimacy. Plus with no one else on set, the girls feel much less inhibited and you always get something special out of them. I had a blast shooting this and I hope you love watching it as much as I like making it.&quot; - Rocco Siffredi

Angel Hott

